import Home from './pages/Home';
import Empreendedora from './pages/Empreendedora';
import './App.css';

class App extends React.Component {
  render() {
  return (
    <div>In√≠cio
        <Routes>
        <Route exact path="/" element={ Home } />
        <Route path="/empreendedora" element={ Empreendedora } />
        </Routes>
        </div>
  );
}
}

export default App;
